import styled from 'styled-components';

export const Container = styled.div`
  background: #ffffff 0% 0% no-repeat padding-box;

  p {
    top: 369px;
    left: 570px;
    text-align: left;
    letter-spacing: 0;
    color: #444444;
    opacity: 1;
    padding-left: 30px;
    padding-top: 10px;
    padding-bottom: 10px;
  }
`;
